  false,\n\t\"url\": null,\n\t\"notes\": \"In November, 2006, Oceanographic observations
  were initiated during the resupply cruises to the Little Port Walter Research Station
  on lower Baranof Island, Southeast Alaska. Six sampling stations were selected starting
  at mid channel, Stephans Passage near Snettisham Inlet then, near the intersection
  of Stephans Passage and Fredrick Sound by Brothers Islands, then, near the intersection
  of Fredrick Sound and Chatham Strait off of Kingsmill Point and then three stations
  across lower Chatham Strait just north of the latitude of Little Port Walter. An
  SBE19plus conductivity, temperature and depth recorder was used to take water samples
  at a speed of approximately one meter per second from the surface to a depth of
  250 meters. These observations are intended to be part of the Southeast Alaska Ocean
  Observing System (SEAOOS). Data are stored as CNV files, HEX files and jpg files
  on Frank Throwers computer.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
